import React from 'react';
import './home.css';
import Navbar from '../../components/common/navbar';
import BackDropImg from '../../images/LandingPage/01-backdrop.jpg';

function home() {
    return (
        <>
            <Navbar />
            <img src={BackDropImg} alt="BackDropImg" />
        </>
    );
}

export default home;
